Salkım salkım tan yelleri estiğinde 
Mavi patiskaları yırtan gemilerinle 
Uzaktan seni düşünürüm İstanbul 
Binbir direkli Halicinde akşam 
Adalarında bahar 
Süleymaniyende güneş 
Hey sen güzelsin kavgamızın şehri
Plajlarında karaborsacılar 
Yağlı gövdelerini kuma sermiştir. 
Kürtajlı genç kızlar cilve yapar karşılarında 
Balıkpazarında depoya kaçırılan fasulyanın 
Meyvesini birlikte devşirirler 
Sen şimdi haramilerin elindesin İstanbul
Haktan bahseden namuslu insanları 
Yağmurlu bir mart akşamı topladılar 
Karanlık mahzenlerinde şehrin 
Cellatlara gün doğdu 
Kardeşlerin acısıyla yanan bir çift gözün vardır 
Bir kalem yazın vardır 
Dudaklarını yakan bir çift sözün vardır 
Söylenmez
Boşuna çekilmedi bunca acılar İstanbul 
Bekle bizi 
Büyük ve sakin Süleymaniyenle bekle 
Parklarınla köprülerinle kulelerinle meydanlarınla 
Mavi denizlerine yaslanmış 
Beyaz tahta masalı kahvelerinle bekle 
Ve bir kuruşa Yenihayat satan 
Tophanenin karanlık sokaklarında 
Koyunkoyuna yatan 
Kirli çocuklarınla bekle bizi 
Bekle zafer şarkılarıyla caddelerinden geçişimizi 
Bekle dinamiti tarihin 
Bekle yumruklarımız 
Haramilerin saltanıtını yıksın 
Bekle o günler gelsin İstanbul bekle 
Sen bize layıksın
